import React from 'react'

import './index.sass'

const DateAndTime = () => {

    const date = Date.now()

    return (
        <div className={'Date-Time'} onClick={() => console.log(date)}>
            <div className='Date'>
                Fri 04.06.2021
            </div>
            <div className='Time'>
                11:27:33 PM
                {date}
            </div>
        </div>
    )
}

export default DateAndTime
